import { Button, Grid, Stack, IconButton, Typography } from "@mui/material";

import AccountCircleRoundedIcon from "@mui/icons-material/AccountCircleRounded";
import { Interactions } from "./Interactions";

export const Content = () => {
  return (
    <Grid
      container
      justifyContent={"center"}
      alignContent={"space-between"}
      sx={{ width: "50%", height: "50%", border: "2.5px white solid" }}
    >
      <Grid item>
        <IconButton size="large">
          <AccountCircleRoundedIcon sx={{ fontSize: "50px" }} />
        </IconButton>
      </Grid>
      <Grid item mt={1}>
        <Typography variant="h5" component="h5" color={"#fff"} Ç>
          Stephen Strange
        </Typography>
      </Grid>
      <Grid item ml={1} mt={1}>
        <Typography variant="h6" component="h6" color={"#ccc"} Ç>
          @drstrange
        </Typography>
      </Grid>
      <Grid item ml={1} mt={1}>
        <Typography variant="h6" component="h6" color={"#ccc"} Ç>
          10/20/16
        </Typography>
      </Grid>
      <Grid item md={12} mx={1} F>
        <Typography variant="body" component="p" color={"#fff"}>
          It's not Mr. Strange, not Master Strange. It's Doctor Strange! When I
          became a doctor, I swore to do no harm.
        </Typography>
      </Grid>
      <Interactions />
    </Grid>
  );
};
